export const theme = {
    colors: {
        mainBlue: 'rgb(84, 185, 209)',
        main40: 'rgba(84, 185, 209, 0.5)',
        black: '#282c37',
        white: '#ffffff',
        grey: '#a4b0be',
        red: '#ff4d4d',
        green: '#3ae374',
        orange: '#fa8231',
    },
}

export type ThemeType = typeof theme;
